css:
  body {
    color: #18453b !important;
    background-color: gainsboro !important;
    background-image: url(http://twinorbs.com/public/helmet_logo_bg.png) !important;
    background-repeat: no-repeat !important;
    background-attachment: fixed !important;
    background-position: center top !important;
    }

    #blueBar {background-color: #18453b !important;}

    #headNav {
    background-color: #18453b !important;
    border: 1px solid white !important;
    border-bottom: 0 !important;
    height: 30px !important;
    margin-left: 180px !important;
    }

    #pageLogo a:hover, #pageNav a:hover, #jewelCase a:hover {background-color: darkgray !important;}

    #pageLogo a, #pageLogo a:hover {
    background-image: url(http://twinorbs.com/public/facebook_icons_msu.png) !important;
    background-repeat: no-repeat !important;
    background-position: 0 -32px !important;
    background-color: #18453b !important;
    display: block !important;
    height: 31px !important;
    width: 103px !important;
    }

    #jewelRequest, #requestsWrapper a:hover {
    background-image: url(http://twinorbs.com/public/facebook_icons_msu.png) !important;
    background-repeat: no-repeat !important;
    background-position: 0 -63px !important;
    }

    #jewelMail, #mailWrapper a:hover {
    background-image: url(http://twinorbs.com/public/facebook_icons_msu.png) !important;
    background-repeat: no-repeat !important;
    background-position: -50px -95px !important;
    }

    #jewelNotif, #notificationsWrapper a:hover {
    background-image: url(http://twinorbs.com/public/facebook_icons_msu.png) !important;
    background-repeat: no-repeat !important;
    background-position: -75px -63px !important;
    }

    .profile-picture {
    border:5px inset #18453b !important !important;
    width:170px !important;}

    .uiBoxGray {
    background-image: url(http://twinorbs.com/public/MSU-Wordmark-Green-120-pxls.png) !important;
    background-repeat: no-repeat !important;
    background-position: center bottom !important;
    }

    #pageFooter, #footerContainer, #contentCol, #contentCurve, .uiTypeahead, .uiBoxWhite, .clearfix {
    background-color: transparent !important;
    }
